import React from 'react';
import logo from './logo.svg';
import './App.css';

function Li(palabra: string) {
  console.log(palabra);
  return <li></li>;
}
const App = () => {
  let x: string = "hola emma";
  return (
    <ul>
      <Li palabra={x}> </Li>
    </ul>
  );
};

export default App;
